import React from "react";
import { Card } from "./Card.styled";
import { ImageCard } from "./ImageCard.styled";
const Headlines = ({ HeadlineProps }) => {
  return (
    <Card bd={"1px solid red"} height={HeadlineProps.height}>
      <Card cl={HeadlineProps.h1.color} fs={HeadlineProps.h1.fontsize}>
        {HeadlineProps.h1.text}
      </Card>
      <Card fs={HeadlineProps.h2.fontsize}>{HeadlineProps.h2.text}</Card>
    </Card>
  );
};

export default Headlines;
